import React from 'react';
import MovieItem from './MovieItem';

const MovieList = ({ movies, movieDetails }) => {
    const renderedList = movies.map((movie) => {
        return <MovieItem movie={movie} />
    });

    return (
        <div>
            {renderedList}
        </div>
    );
};

export default MovieList;
